import React from 'react';
import '../style/App.css';

export default function header() {
  return (
    <div class="row match-header-div">
      <div class="col align-self-center banner_img_div">
        <img src="PoroBetsCover.jpg" className="banner_img"></img>
      </div>
    </div>
  )
}
